import React, { useState } from 'react'
import styles from './List.module.css'
import SearchInput from './SearchInput.tsx'
import ListOfWork from './ListOfWork.tsx'

const List = (props) => {
    const [purpose,setPurpose] = useState('')
    const addNewPurpose = (value) => {
        setPurpose(value)
    }
    return(
        <div className={styles.list}>
            <SearchInput addNewPurpose={addNewPurpose}/>
            <ListOfWork purposes={purpose}/>
        </div>
    )
}

export default List
